-- Table structure for wf_category
-- ----------------------------
DROP TABLE IF EXISTS `wf_category`;
CREATE TABLE `wf_category` (
  `category_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '流程分类id',
  `category_name` varchar(64) DEFAULT '' COMMENT '流程分类名称',
  `code` varchar(64) DEFAULT '' COMMENT '分类编码',
  `remark` varchar(500) DEFAULT '' COMMENT '备注',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标志（0代表存在 2代表删除）',
  PRIMARY KEY (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1696342867264770050 DEFAULT CHARSET=utf8mb4 COMMENT='流程分类表';

